description:
Les données de la base nationale sur les intercommunalités (BANATIC) comportent des informations sur les intercommunalités.
Vous trouverez plusieurs fichiers :
* **Liste des groupements** : la situation géographique, la nature juridique, la date de création, le périmètre, le profil financier ;
* **Coordonnées des groupements** : des moyens pour contacter un groupement ;
* **Compétences des groupements** : les compétences exercées par les groupements ;
* **Périmètre des EPCI à fiscalité propre**.
* **Table de passage entre codes INSEE des communes et SIREN**
## Site web et exports complémentaires
Ces données sont publiées sur le site <https://www.banatic.interieur.gouv.fr>. Vous pourrez exporter des données uniquement pour certaines régions ou départements sur ce site.

Ce jeu de données contient quatre fichiers au format XML :
-	le texte de la 1ère partie du projet de loi de finances pour 2018 ;
-	le texte de la 2nde partie du projet de loi de finances pour 2018 ;
-	le texte de la 1ère partie du projet de loi de finances pour 2019 ;
-	le texte de la 2nde partie du projet de loi de finances pour 2019 ;
La structure de ce document est conforme au standard Akoma Ntoso utilisé pour représenter des textes de nature législative et réglementaire. Une présentation exhaustive de ce standard peut être trouvée à l’adresse suivante :
http://docs.oasis-open.org/legaldocml/akn-core/v1.0/os/part1-vocabulary/akn-core-v1.0-os-part1-vocabulary.html
Par ailleurs, une notice expliquant la manière dont le Sénat utilise le standard Akoma Ntoso est également mise à disposition.

Lancée le 3 octobre par le président de la République et pilotée par Jean-Paul Delevoye, haut-commissaire aux Retraites, la « consultation citoyenne en ligne sur les retraites » a permis à chacun de s’informer et d’exprimer ses interrogations, ses espoirs et ses inquiétudes concernant le futur système universel de retraites jusqu'au 8 décembre 2019.
Cette consultation s'articulait autour de trois modules :
   • un questionnaire rapide pour s’exprimer en quelques minutes sur les priorités et les solutions proposées pour le futur système universel ;
   • un module présentant les principales préconisations du haut-commissaire et permettant à tous de donner un avis ;
   • un module de questions/réponses pour permettre chaque semaine à Jean-Paul Delevoye de répondre aux 5 questions les plus soutenues.

